USE Furniture_Store_Data;

CREATE TABLE furn_customers_data(
	customer_id INT NULL,
	customer_name VARCHAR(50) NULL
);


CREATE TABLE furn_orders_data(
	order_id INT NULL,
	customer_id INT NULL,
	product_id INT NULL,
	order_date DATE NULL,
	quantity INT NULL
);


CREATE TABLE furn_products_data(
	product_id INT NULL,
	product_name VARCHAR(50) NULL,
	purchase_price INT NULL,
	product_category VARCHAR(50) NULL
);


CREATE TABLE furn_ratings_data(
	customer_id INT NULL,
	product_id INT NULL,
	product_rating INT NULL
);


SELECT * FROM furn_customers_data;

SELECT * FROM furn_orders_data;

SELECT * FROM furn_products_data;

SELECT * FROM furn_ratings_data;

-- SQL Queries

-- Total Quantity

SELECT SUM(quantity) AS Total_Qauntity 
FROM furn_orders_data;

-- Total Products

SELECT SUM(DISTINCT(product_id)) AS Total_Product_IDs
FROM furn_orders_data;

-- Top 10 Product Name 

SELECT Top 10 product_name, 
SUM(DISTINCT(purchase_price)) AS Total_Product_Price
FROM furn_products_data
GROUP BY product_name
ORDER BY Total_Product_Price DESC;

-- Bottom 10 Product Name 

SELECT Top 10 product_name, 
SUM(DISTINCT(purchase_price)) AS Total_Product_Price
FROM furn_products_data
GROUP BY product_name
ORDER BY Total_Product_Price;

-- Top 5 Product Category

SELECT Top 5 product_category, 
SUM(DISTINCT(purchase_price)) AS Total_Product_Price_By_Category
FROM furn_products_data
GROUP BY product_category
ORDER BY Total_Product_Price_By_Category DESC;

-- Bottom 5 Product Category 

SELECT Top 5 product_category, 
SUM(DISTINCT(purchase_price)) AS Total_Product_Price_By_Category
FROM furn_products_data
GROUP BY product_category
ORDER BY Total_Product_Price_By_Category;

-- Top 5 Product Category

SELECT Top 10 product_id, 
SUM(DISTINCT(product_rating)) AS Total_Product_Ratings
FROM furn_ratings_data
GROUP BY product_id
ORDER BY Total_Product_Ratings DESC;

-- Bottom 5 Product Category

SELECT Top 10 product_id, 
SUM(DISTINCT(product_rating)) AS Total_Product_Ratings
FROM furn_ratings_data
GROUP BY product_id
ORDER BY Total_Product_Ratings;

SELECT Top 10 product_name
FROM furn_products_data


-- Joins

SELECT *
FROM furn_customers_data
INNER JOIN furn_orders_data
	ON furn_customers_data.customer_id = furn_orders_data.customer_id;

SELECT * FROM furn_products_data
INNER JOIN furn_ratings_data
	ON furn_products_data.product_id = furn_ratings_data.product_id;
	
SELECT *
FROM furn_customers_data
LEFT JOIN furn_orders_data
	ON furn_customers_data.customer_id = furn_orders_data.customer_id;

SELECT * FROM furn_products_data
LEFT JOIN furn_ratings_data
	ON furn_products_data.product_id = furn_ratings_data.product_id;

SELECT customer_name
FROM furn_customers_data
INNER JOIN furn_orders_data
	ON furn_customers_data.customer_id = furn_orders_data.customer_id
WHERE quantity = 4
GROUP BY customer_name;
